function loginUser() {
    loginButton.click(function (e) {
        if (!sessionID) {
            e.preventDefault();
            loginErrorArray = [];
            emailValidation = isWaitemataDHB(loginEmail.val());
                callAPIEndpoint('ajax/connect', 'POST', 'username=' + loginUsername.val() + '&email=' + loginEmail.val() + '&emailValidate=' + emailValidation, function (result) {
                    if (result.error) {
                        if (result.itemError == "username") {
                            loginUsername.addClass('error-shake');
                            errorUsername.text(result.message);
                            loginErrorArray.push('Error');

                        } else {
                            loginUsername.removeClass('error-shake');
                            errorUsername.text('');
                        }

                        if (result.itemError == "email") {
                            loginEmail.addClass('error-shake');
                            errorEmail.text(result.message);
                            loginErrorArray.push('Error');

                        } else {
                            loginEmail.removeClass('error-shake');
                            errorEmail.text('');
                        }

                    } else {
                        sessionStorage.setItem("session_id", result.data.id);
                        sessionStorage.setItem("session_name", result.data.name);
                        location.href = loginButton.attr('href');
                    }
                });
            loginUsername.delay(200).removeClass('error-shake');
            loginEmail.delay(200).removeClass('error-shake');
        }
    });
}

function sessionContinue() {
    sessionLoginBtn.click(function (e) {
        e.preventDefault();
        callAPIEndpoint('ajax/promsrelogin', 'POST', 'username=' + sessionLoginUsername.val() + '&email=' + sessionLoginEmail.val(), function (result) {
            if (result.error) {
                if (result.itemError == "username") {
                    sessionLoginUsername.addClass('error-shake');
                    sessionErrorName.text(result.message);

                } else {
                    sessionLoginUsername.removeClass('error-shake');
                    sessionErrorName.text('');
                }

                if (result.itemError == "email") {
                    sessionLoginEmail.addClass('error-shake');
                    sessionErrorEmail.text(result.message);
                } else {
                    sessionLoginEmail.removeClass('error-shake');
                    sessionErrorEmail.text('');
                }
            } else {
                sessionStorage.setItem("session_id", result.data.id);
                sessionStorage.setItem("session_name", result.data.name);
                sessionStorage.setItem("session_url", result.data.url);
                location.href = result.data.url;
            }
        });
        sessionLoginEmail.delay(200).removeClass('error-shake');
        sessionLoginUsername.delay(200).removeClass('error-shake');
    });
}

function addPromsChampions() {
    promsChampButton.click(function (e) {
        nextURL =  $(this).attr('href');
        promsEmailArray  = [], promsNameArray = [], promsFlagErrorArray = [];
        promsChampInputs = promsChampForm.find('.input-form');
        promsChampInputs.each(function (i) {
            promsChampName     = $(this).find('input[type="text"]');
            promsChampEmail    = $(this).find('input[type="email"]');
            promsInvalidEmail  = promsChampEmail.next('#error_message');
            promsInvalidName   = promsChampName.next('#error_message');
            if (i < 2) { // Checking first two input validation
                if (promsChampName.length > 0) {
                    if (promsChampName.val()) {
                        promsInvalidName.text('');
                        promsChampName.removeClass('error-shake');
                        promsNameArray.push(promsChampName.val());
                    } else {
                        promsChampName.addClass('error-shake');
                        promsInvalidName.text(InvalidNameError);
                        promsFlagErrorArray.push('Error');
                    }
                }

                if (promsChampEmail.length > 0) {
                    if(promsChampEmail.val()) {

                        emailValidation = isWaitemataDHB(promsChampEmail.val());
                        if(emailValidation) {
                            promsInvalidEmail.text('');
                            promsChampEmail.removeClass('error-shake');
                            promsEmailArray.push(promsChampEmail.val());

                        } else {
                            if (promsInvalidEmail.length > 0) {
                                promsChampEmail.addClass('error-shake');
                                promsInvalidEmail.text(InvalidEmailError);
                                promsFlagErrorArray.push('Error');
                            }
                        }
                    } else {
                        promsChampEmail.addClass('error-shake');
                        promsInvalidEmail.text(InvalidEmailError);
                        promsFlagErrorArray.push('Error');
                    }
                }
            }else {
                if (promsChampName.length > 0) {
                    if (promsChampName.val()) {
                        promsNameArray.push(promsChampName.val());
                    }
                }
                if (promsChampEmail.length > 0) {
                    if (promsChampEmail.val()) {
                        promsEmailArray.push(promsChampEmail.val());
                    }
                }
            }
        });

        if(promsFlagErrorArray.length < 1) {
            for(let i = 0; i < promsNameArray.length; i++) {
                callAPIEndpoint('ajax/promschampionform', 'POST', 'id=' + sessionID + '&username=' + promsNameArray[i] + '&email=' + promsEmailArray[i] + '&nextURL=' + nextURL, function (result) {
                    if (result.error == "true") {
                        e.preventDefault();
                    }else {
                        sessionStorage.setItem("session_url", result.data.sessionUrl);
                    }
                });
            }
        } else {
            e.preventDefault();
        }
    });

}

