function savePromsFormData() {
    if (pageTitle) {
        questionButton.click(function (e) {
            nextURL =  $(this).attr('href');
            sessionStorage.setItem("session_url", nextURL);
            noAnswerArray = [], storeQuestion = [], storeAnswer = [];
            if (questionInputs.length > 0) {
                questionInputs.each(function () {
                    formQuestion = $(this).find('.hidden_question').val();
                    trimQuestion = $.trim(formQuestion);
                    formAnswer   = $(this).find('textarea').val();
                    trimAnswer   = $.trim(formAnswer);

                    questionErrorMessage = $(this).find('#error_message');

                    if (trimAnswer) {
                        questionErrorMessage.text('');
                        storeQuestion.push(trimQuestion);
                        storeAnswer.push(trimAnswer);

                    } else {
                        noAnswerArray.push("No Answer");
                        questionErrorMessage.text(InputAnswer);
                    }
                });
            } else {
                callAPIEndpoint('ajax/promsquestionform', 'POST', 'id=' + sessionID + '&question=' + pageTitle + '&answer=NA&page_title=' + pageTitle + '&nextURL=' + nextURL, function (result) {
                });
            }

            if (noAnswerArray.length > 0) {
                e.preventDefault();
            } else {
                for (let i = 0; i < storeQuestion.length; i++) {
                    callAPIEndpoint('ajax/promsquestionform', 'POST', 'id=' + sessionID + '&question=' + storeQuestion[i] + '&answer=' + storeAnswer[i] + '&page_title=' + pageTitle + '&nextURL=' + nextURL, function (result) {
                    });
                }
            }
        });
    }
}

function completeSession() {
    if (sessionName) {
        downloadBtn.text('PROMs Checklist - ' + sessionName);
        downloadBtn.click(function (e) {
            var item_test, lineItem_test;
            e.preventDefault();
            doc.text('The PROMs Checklist', 11, 40);
            //doc.text('Hello! ' + sessionName, 11, 40);
            description = doc.setFontSize(10).splitTextToSize(loremipsum, pdfContentWidth);
            doc.text(12, 50, description);
            callAPIEndpoint('ajax/getpromsresult', 'POST', 'id=' + sessionID , function (result) {
                promsResultData = result.data;
                for (key in promsResultData) {
                    resultStep     = promsResultData[key]['step'];
                    resultQuestion = promsResultData[key]['question'];
                    resultAnswer   = promsResultData[key]['answer'];
                    if (resultStep != "Maori Engagement" && resultStep != "Paper Surveys") {
                        if(pdfMargin >= 250) {
                            pdfMargin = 10;
                            doc.addPage('a4','portrait');

                            item_test     = resultStep;
                            lineItem_test = doc.setFontStyle('bold').setFontSize(12).splitTextToSize(item_test, pdfContentWidth);
                            doc.text(12, pdfMargin + 22, lineItem_test);

                            item = resultQuestion + '\n\n' + resultAnswer;
                            lineItem = doc.setFontStyle('normal').setFontSize(11).splitTextToSize(item, pdfContentWidth);
                            doc.text(12, pdfMargin + 30, lineItem);
                            pdfMargin += ((lineItem.length + 0.5) * 6.5) + (lineItem_test.length * 8);
                        }else{
                            item_test     = resultStep;
                            lineItem_test = doc.setFontStyle('bold').setFontSize(12).splitTextToSize(item_test, pdfContentWidth);
                            doc.text(12, pdfMargin + 22, lineItem_test);

                            item = resultQuestion + '\n\n' + resultAnswer;
                            lineItem = doc.setFontStyle('normal').setFontSize(11).splitTextToSize(item, pdfContentWidth);
                            doc.text(12, pdfMargin + 30, lineItem);
                            pdfMargin += ((lineItem.length + 0.5) * 6.5) + (lineItem_test.length * 8);
                        }
                    }
                }
            });
            setTimeout(function() {
                doc.save('a4.pdf');
            },2000);
        });
    }
}

